head.ready(function() {
	var Default = {
		utils : {
			links : function(){
				$('a[rel*=external]').on('click',function(e){
					e.preventDefault();
					window.open($(this).attr('href'));						  
				});
			},
			mails : function(){
				$('.email').each(function(index){
					em = $(this).text().replace('//','@').replace(/\//g,'.');
					$(this).text(em).attr('href','mailto:'+em);
				});
			},
			forms : function(){
				$('.form-a textarea').each(function(){
					if($(this).val() !== '') $(this).parent().children('label').css('margin-top','-3000em');
				}).on('focus',function(){
					$(this).parent().children('label').css('margin-top','-3000em');
				}).on('blur',function(){
					if($(this).val() === '') $(this).parent().children('label').css('margin-top',0);
				});
				$('.form-a input').on('focus',function(){ $(this).parent().addClass('focus'); }).on('blur',function(){ $(this).parent().removeClass('focus'); }).parent().addClass('a');
				xa = $('fieldset > *');
				xb = parseInt(xa.size());
				xa.each(function(){ $(this).css({'z-index':xb}); xb--; });
			},
			date : function(){
				$('#footer .date').text((new Date).getFullYear());
			},
			gallery : function(){
				$('.filter-a > .gallery-a').each(function(){ $(this).isotope({ itemSelector: 'li', layoutMode: 'fitRows' }) });
				$('.filter-a nav li:first-child').addClass('active');					
				$('.filter-a nav a').on('click',function(){
					$(this).parents('ul').find('.active').removeClass('active');
					$(this).parent().addClass('active');
					$(this).parents('nav').next('.gallery-a').isotope({ filter: $(this).attr('data-filter') });
					return false
				});
			},
			tabs : function(){
				$('[class*="tabs"] > div > *:not(:first-child)').addClass('hidden');
				$('[class*="tabs"] > ul > li:first-child').addClass('active');
				$('[class*="tabs"] > ul > li').children('a').on('click',function(){
					$(this).parents('ul').children('li').removeClass('active');
					$(this).parent('li').addClass('active').parents('ul').next('div').children().addClass('hidden').parent().children(':eq('+$(this).parents('ul').children('li').index($(this).parent())+')').removeClass('hidden');
					return false;
				});
			},
			accordion : function(){
				$('.accordion-a > h3:first-child, .accordion-a > h4:first-child').addClass('active');
				$('.accordion-a > h3:not(:first-child) + div, .accordion-a > h4:not(:first-child) + div').hide();
				$('.accordion-a > h3, .accordion-a > h4').on('click',function(){ 
					if($(this).hasClass('active')){
						$(this).removeClass('active').next().slideUp(); 
					}
					else {
						$(this).parents('.accordion-a').find('.active').removeClass('active').next().slideUp();
						$(this).toggleClass('active').next().slideToggle(); 
					}
				});
			},
			charts : function(){
				if(!$('html').hasClass('lt-ie9')){
					$('.list-g li').append('<canvas width="166" height="166"></canvas>');
					$('.list-g canvas').wrap('<div class="chart"></div>').parent('.chart');
					$('.list-g canvas').each(function(){ 
						var ctx = $(this).get(0).getContext('2d');				
						new Chart(ctx).Doughnut([
							{
								value: 100-parseInt($(this).parents('li').children('span').text()),
								color : "#aa5fa4"
							},
							{
								value: parseInt($(this).parents('li').children('span').text()),
								color: "#ffffff"
							}				
						],{ segmentShowStroke : false, percentageInnerCutout : 90, animation : false });
					});
				}
			},
			miscellaneous : function(){
				var tn=1; $('ol > li').each(function(){$(this).prepend('<span class="no">'+tn+'.</span> '); tn++;});
				$('.slider-a, .list-g, #welcome, .gallery-f li > span, .slider-b, .scheme-f').wrapInner('<div class="inner"></div>');
				$('#top, .gallery-a li a').append('<div class="fit-a"></div>');
				$('.gallery-a li a').append('<div class="fit-b"></div>');
				$('#top > .fit-a').on('click',function(){ $(this).parent().toggleClass('active'); return false });	
				if(!($.browser.msie && parseInt($.browser.version,10) < 9)){ if($('.image-a').size()){ $('.image-a img').wrap('<span class="img"></span>').imageMask('images/masks/a.png'); } }
				$('.slider-a > .inner, .slider-b > .inner').each(function(){ $(this).bxSlider({ pager: true, controls: false, useCSS: false, adaptiveHeight: true }); });
				$('#welcome').each( function(){ if($(this).find('article').size()>1){ $('#welcome > .inner').each(function(){ $(this).bxSlider({ pager: true, controls: false, useCSS: false, adaptiveHeight: true }); }); }});
				$('#featured, #welcome article').each(function(){ $(this).css({'background-image':'url("'+$(this).find('img').attr('src')+'")'}); });
				$('html').on('click',function(){ $('#top.active').removeClass('active'); });
				$('.notice-a').append('<a class="close">Close</a>');
				$('.notice-a > .close').on('click',function(){ $(this).parent().remove(); return false });
				$('.filter-a nav ul li:first-child').addClass('active');
				$('.gallery-a li > span, .gallery-a li a > span, .gallery-b li > span, .gallery-b li > a > span').each(function(){ $(this).css('margin-top',-$(this).outerHeight()*.5); });
				$('#welcome article > div, #welcome article > header').each(function(){ $(this).css('margin-top',-$(this).outerHeight()*.5+20); });
				//$('.gallery-f li > span > .inner').each(function(){ $(this).css('margin-top',-$(this).outerHeight()*.5); });
				$('.list-i, .gallery-c').wrap('<div class="wrapper"></div>');
				$('.gallery-b .link-a').wrap('<div></div>');
				$('.gallery-f li > span').each(function(){ $(this).css('height',$(this).parents('li').find('img').outerHeight()); });
			}
		},
		ie : {
			css : function() {
				if($.browser.msie && parseInt($.browser.version,10) < 9){
					$('body').append('<p class="lt-ie9">You are using an outdated browser. Please <a target="_blank" href="http://browsehappy.com/">upgrade your browser</a> to improve your experience.</p>').css('padding-top','28px');
					$('input[placeholder], textarea[placeholder]').placeholder();
					$(':last-child').addClass('last-child');
					$('hr').wrap('<div class="hr"></div>');
					$('.list-i li:nth-child(3n), .gallery-e li:nth-child(3n), .gallery-f li:nth-child(2n)').addClass('nth-a');
				}
			},
			pie : function() {
				if($.browser.msie && parseInt($.browser.version,10) < 9){
					if(window.PIE){
						$('.nav-a ul li a span, .list-c li a, .comments-a > li img, .news-b article, .pagination-a li a, .pagination-a li a, .list-h li a, .list-g li span, .gallery-d li, .link-a a, .scheme-f a').each(function(){
							PIE.attach(this);
						});
					}				
				}
				if($.browser.msie && parseInt($.browser.version,10) == 8){
					if(window.PIE){
						$('button').each(function(){
							PIE.attach(this);
						});
					}				
				}
			}
		}

	};

	Default.utils.links();
	Default.utils.mails();
	Default.utils.forms();
	Default.utils.date();
	Default.utils.miscellaneous();
	Default.utils.gallery();
	Default.utils.accordion();
	Default.utils.charts();
	Default.utils.tabs();
	Default.ie.css();
	Default.ie.pie();
});

/*!*/